/*Table structure for table `EmpTable` */

DROP TABLE IF EXISTS `EmpTable`;

CREATE TABLE `EmpTable` (
  `empId` char(100) NOT NULL,
  `empName` varchar(50) NOT NULL,
  `empPass` varchar(50) DEFAULT NULL,
  `empDept` varchar(30) DEFAULT NULL,
  `empSex` varchar(10) NOT NULL,
  `empPhone` char(20) NOT NULL,
  `empNum` char(30) NOT NULL,
  `empMail` varchar(100) NOT NULL,
  PRIMARY KEY (`empId`),
  KEY `empDept` (`empDept`),
  CONSTRAINT `emptable_ibfk_1` FOREIGN KEY (`empDept`) REFERENCES `dept` (`deptName`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

