/*Table structure for table `dataProce_t` */

DROP TABLE IF EXISTS `dataProce_t`;

CREATE TABLE `dataProce_t` (
  `empName` varchar(50) NOT NULL DEFAULT '',
  `dates` varchar(50) NOT NULL DEFAULT '',
  `dept` varchar(50) NOT NULL DEFAULT '',
  `days` float(2,1) NOT NULL DEFAULT '0.0',
  `hours` int(11) NOT NULL DEFAULT '0',
  `late` int(11) NOT NULL DEFAULT '0',
  `earlyRetr` int(11) NOT NULL DEFAULT '0',
  `overTime` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`empName`,`dates`,`dept`,`days`,`hours`,`late`,`earlyRetr`,`overTime`),
  KEY `dept` (`dept`),
  CONSTRAINT `dataproce_t_ibfk_1` FOREIGN KEY (`dept`) REFERENCES `dept` (`deptName`) ON UPDATE CASCADE
