insert  into `noticeContet`(`id`,`title`,`TIME`,`content`) values ('2863f3157dd544e5b1c42f4667f9fdb8','测试3','2019-01-02 18:31:32','<img src=\"http://localhost:8080/images/1546425090861.png\" alt=\"1546425090861.png\">'),('514c7989a1aa41be939ddfaa555df2ac','测试4','2019-01-02 18:33:00','从<img src=\"http://localhost:8080/layui/images/face/0.gif\" alt=\"[微笑]\"><img src=\"http://localhost:8080/layui/images/face/13.gif\" alt=\"[偷笑]\">haha哈哈搜索'),('540a255ace324f78ab0dd234f6cce070','2019年会通知','2019-01-15 15:38:11','2019年会详情'),('5b7bbedc8afc46dea33100d3d19df38c','2019年上班日期','2019-01-02 17:12:00','<p>2月10日开始正式上班</p><p>&nbsp; &nbsp; 新年快乐</p>'),('657d427395c5429489028f45d0fdf8b2','2019年元旦放假通知','2019-01-02 15:46:58','<img src=\"http://localhost:8080/images/1546415194716.png\" alt=\"1546415194716.png\">'),('74d70cce9945478783aada216052bd50','2018年年末聚餐活动通知','2019-01-02 16:25:57','柳州饭店'),('907d58f4d62d48eb932ff474e54040bf','2018年年末聚餐活动通知','2019-01-02 16:25:59','柳州饭店'),('e9341c0ba0d241d68e69cbbba95f0141','测试2','2019-01-02 17:13:37','11111'),('fb69bbeeb9e046258b9a391df0c03704','整顿校风','2019-01-02 17:44:58','<div>&nbsp;要求：1.各班级同学按时上课、遵守课堂纪律、严格规范言行举止；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.晚上晚自习7:30-9:30期间，各班级按要求离开宿舍到图书馆、教室进行晚自习，不得在学习或休息时间玩游&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;戏；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.各班级不得出现晚归或夜不归宿情况，请宿舍成员相互提醒督促；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.学院各宿舍勤打扫、保证内务卫生整洁干净；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5.考研复习同学请将考研教室出入证等相关证明按考研教室管理规定执行。<br>各班级：<br>&nbsp;&nbsp;根据学校要求，即日起学校将对以下工作加强检查管理力度：<br>&nbsp;&nbsp;1.上课考勤、校园文明行为、课堂学习纪律的检查；<br>&nbsp;&nbsp;2.学生宿舍的安全巡查、内务卫生检查和作息时间内宿舍学习情况检查；<br>&nbsp;&nbsp;3.学生晚自习、晚归、夜不归宿等情况的检查；<br><br>学校将组织人员每天对学生上课或晚自习考勤、课堂违纪、学习或休息时间玩网络游戏、宿舍内务卫生、晚归或夜不归宿等情况进行随机检查，并对违纪学生进行实名通报，学生被通报次数累计达到3次以上者，将根据《广西科技大学普通本专科学生纪律处分规定》的相关规定给予纪律处分。<br><br>要求：1.各班级同学按时上课、遵守课堂纪律、严格规范言行举止；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.晚上晚自习7:30-9:30期间，各班级按要求离开宿舍到图书馆、教室进行晚自习，不得在学习或休息时间玩游&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;戏；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.各班级不得出现晚归或夜不归宿情况，请宿舍成员相互提醒督促；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.学院各宿舍勤打扫、保证内务卫生整洁干净；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5.考研复习同学请将考研教室出入证等相关证明按考研教室管理规定执行。<br><br>&nbsp;&nbsp;请学院各班级配合学校工作要求，各班级班干加强班级课堂出勤、晚自习、晚归及夜不归宿等纪检工作力度，提醒督促同学们严格遵守相关要求，谢谢&nbsp;</div>');

