/*Table structure for table `workTimeTable` */

DROP TABLE IF EXISTS `workTimeTable`;

CREATE TABLE `workTimeTable` (
  `empName` varchar(50) NOT NULL DEFAULT '',
  `dept` varchar(30) NOT NULL DEFAULT '',
  `dates` varchar(50) NOT NULL DEFAULT '',
  `workMorn` varchar(50) NOT NULL DEFAULT '',
  `atNoon` varchar(50) NOT NULL DEFAULT '',
  `workAfter` varchar(50) NOT NULL DEFAULT '',
  `atNight` varchar(50) NOT NULL DEFAULT '',
  PRIMARY KEY (`empName`,`dept`,`dates`,`workMorn`,`atNoon`,`workAfter`,`atNight`),
  KEY `dept` (`dept`),
  CONSTRAINT `worktimetable_ibfk_1` FOREIGN KEY (`dept`) REFERENCES `dept` (`deptName`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

